import image3 from "../../assets/image3.png";
import image4 from "../../assets/image4.png";
import tick from "../../assets/tick.png";

const Reasons = () => {
    return (
        <div className="reasons" id="reasons">
            <div className="left-r">
                <img src={image1} alt="" />
                <img src={image2} alt="" />
                <img src={image3} alt="" />
                <img src={image4} alt="" />
            </div>
            <div className="right-r">
                <span>some reasons</span>
                <div><span className="stroke-text">why </span><span> choose us</span></div>
                <div className="details-r">
                    <div><img src={tick} alt="" /><span>OVER 140+ EXPERT COACHS</span></div>
                    <div><img src={tick} alt="" /><span>TRAIN SMARTER ABD FASTER THAN BEFORE</span></div>
                    <div><img src={tick} alt="" /><span>1 FREE PROGRAM FOR NEW MEMBER</span></div>
                    <div><img src={tick} alt="" /><span>RELIABLE PARTNERS</span></div>
                </div>
                <span style={{
                    color: 'var(--gray)', fontWeight: 'normal',
                }}>Our PARTNERS</span>
                <div className="partners">
                    <img src={nb} alt="" /><img src={adidas} alt="" /><img src={nike} alt="" />
                </div>
            </div>
        </div>
    );
}

export default Reasons;
